import React from 'react';

const OfflineSensors = ({ offlineSensors }) => {
    return (
        <div>
        <h2>Offline Sensors</h2>
        <ul>
            {Object.values(offlineSensors).map(sensor => (
                sensor.historical_data != [] && (
                    <li key={sensor.serial_number}>
                        <p>Serial Number: {sensor.serial_number}</p>
                        <p>Status: {sensor.status}</p>
                        <ul>
                        {sensor.historical_data.map(row => (
                            <li key={row.timestamp}>
                            <p>Timestamp: {row.timestamp}</p>
                            <p>Value: {row.value}</p>
                            {/* Other properties you want to render from historical_data */}
                            </li>
                        ))}
                        </ul>
                    </li>
                )
            ))}
        </ul>
        </div>
    );
};

export default OfflineSensors;
